column13:
A process for preparing an alkaline earth metal alkylhydroxybenzoate reaction product, said process comprising: 
a) neutralizing at least one alkylphenol with an alkali metal base to form an alkali metal alkylphenate; 
b) carboxylating the alkali metal alkylphenate with carbon dioxide to obtain an alkali metal alkylhydroxybenzoate; and 
c) acidifying the alkali metal alkylhydroxybenzoate to form the alkylhydroxybenzoic acid, and further reacting the alkylhydroxybenzoic acid with a molar excess of an alkaline earth metal base to form an alkaline earth metal alkylhydroxybenzoate reaction product; 

wherein at least one of the alkylphenol, alkylphenate, alkylhydroxbenzoic acid, alkali metal alkylhydroxybenzoate and alkaline earth metal alkylhydroxybenzoate is reacted with a sulfur source to achieve a sulfur content in the range of about 0.1 to 1.2 wt % in the alkaline earth metal alkylhydroxybenzoate reaction product, and wherein at least 50 mole % of the starting alkylphenol is converted to the alkaline earth metal alkylthydroxybenzoate reaction product.

This invention provides processes for the preparation of a compound of Formula I: 

YC(O)C(R ^{ 1 } )(R ^{ 2 } )CH _{ 2 } S(O) _{ n } R ^{ 3 } 

wherein: 

Y is hydroxy or XONX, where each X is independently hydrogen, lower alkyl or lower acyl; 

R ^{ 1 } is hydrogen or lower alkyl; 

R ^{ 2 } is hydrogen, lower alkyl, aryl, aralkyl, cycloalkyl, cycloalkylalkyl, or R ^{ 1 } and R ^{ 2 } together with the carbon atom to which they are attached form a cycloalkyl or heterocyclo group; 

R ^{ 3 } is aryl; and 

n is 0, 1 or 2. 

The invention also provides novel aryl haloalkyl sulfide intermediates useful for the preparation of compounds of Formula I and novel methods of preparing aryl alkyl sulfides.

